const angles = [[0, 1], [0, 4], [0, 16], [1, 2], [2, 3], [4, 5], [4, 8], [4, 16], [5, 6], [5, 8], [6, 7], [8, 9], [8, 12], [9, 10], [9, 12], [10, 11], [12, 13], [12, 17], [13, 14], [13, 17], [14, 15], [16, 17], [16, 18], [17, 18], [18, 19], [19, 20]]

function dotproduct(v1, v2){
    sum = 0;
    for (var i = 0; i < Math.max(v1.length, v2.length); i++) {
        sum += v1[i] * v2[i];
    }
    return sum
}

function length(v){
    return Math.sqrt(dotproduct(v,v));
}

function angle(v1, v2){
    return Math.acos(dotproduct(v1,v2)/(length(v1) * length(v2)));
}

function vec(hand, pair){
    var a = pair[0];
    var b = pair[1]
    return [hand[b].x - hand[a].x, hand[b].y - hand[a].y, hand[b].z - hand[a].z]
}

function dists(hand){
    var d = []
    for (const pair of angles){
        var a = pair[0];
        var b = pair[1];
        const i = DIST_PAIRS[a];
        const j = DIST_PAIRS[b];
        var v1 = vec(hand, i)
        var v2 = vec(hand, j)
        d.push(angle(v1, v2))
    }
    return d
}

function _classify(dists, hand, l){
    function helper(i){
        var sum = 0
        for (var j = 0; j < i.length; j++){
            sum += Math.abs(dists[j] - i[j])
        }
        return sum
    }
    var min = Number.POSITIVE_INFINITY;
    var min_idx = -1;
    for (var el of l){
        if (min > helper(el)){
            min = helper(el);
            min_idx = el
        }
    }
    var s = "abcdefghijklmnopqrstuvwxyz"[l.indexOf(min_idx)]
    if (s == 'y'){
        if (Math.abs(hand.landmark[4].x - hand.landmark[6].x) < Math.abs(hand.landmark[5].x - hand.landmark[9].x)){
            x = 'i';
        }
    }
    return s
}

function classify(dists, hand){
    var x = []
    for (const i of letters){
        var val = _classify(dists, hand, i)
        x.push(val)
    }
    console.log(x)
    max = Number.NEGATIVE_INFINITY
    var counts = {};
    for (var i = 0; i < x.length; i++) {
        var num = x[i];
        counts[num] = counts[num] ? counts[num] + 1 : 1;
    }
    var max;
    var max_idx;
    Object.keys(counts).forEach(function(key){
        if (counts[key] > max){
            max = counts[key]
            max_idx = key
        }
    });
    return max_idx
}


function onResults(results) {
    canvasCtx.save();
    canvasCtx.clearRect(0, 0, canvasElement.width, canvasElement.height);
    canvasCtx.drawImage(
        results.image, 0, 0, canvasElement.width, canvasElement.height);
    if (results.multiHandLandmarks) {
        var hand = results.multiHandLandmarks[0]
        console.log(classify(dists(hand), hand))
        for (const landmarks of results.multiHandLandmarks) {
            drawConnectors(canvasCtx, landmarks, HAND_CONNECTIONS,
                { color: '#00FF00', lineWidth: 5 });
            drawLandmarks(canvasCtx, landmarks, { color: '#FF0000', lineWidth: 2 });
        }
    }
    canvasCtx.restore();
}

const hands = new Hands({
    locateFile: (file) => {
        return `https://cdn.jsdelivr.net/npm/@mediapipe/hands/${file}`;
    }
});
hands.setOptions({
    maxNumHands: 2,
    minDetectionConfidence: 0.5,
    minTrackingConfidence: 0.5,
    staticImageMode: true
});
hands.onResults(onResults);

const camera = new Camera(videoElement, {
    onFrame: async () => {
        await hands.send({ image: videoElement });
    },
    width: 1280,
    height: 720
});
camera.start();